// Navbar.js
import React, { useState } from 'react';
import { FiMenu } from 'react-icons/fi';
import { RxCross1 } from 'react-icons/rx';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const [nav, setNav] = useState(false);
  const handleNav = () => {
    setNav(!nav);
  };

  return (
    <div className='bg-gray-900 text-white'>
      <div className='flex justify-between items-center h-24 max-w-[1200px] mx-auto px-6 md:px-0'>
        <Link to="/" className='text-4xl text-amber-400 font-extrabold'>UrbanRoost</Link>

        <ul className={nav ? 'hidden md:flex' : 'md:flex space-x-4'}>
          <li><Link to="/" className='hover:text-amber-400 transition duration-300'>Home</Link></li>
          <li><Link to="/about" className='hover:text-amber-400 transition duration-300'>About</Link></li>
          <li><Link to="/contact" className='hover:text-amber-400 transition duration-300'>Contact</Link></li>
          <li><Link to="/signup" className='btn'>Sign Up</Link></li>
          <li><Link to="/signin" className='btn btn-outline'>Sign In</Link></li>
        </ul>

        <div onClick={handleNav} className='block md:hidden cursor-pointer'>
          {nav ? <RxCross1 size={20} /> : <FiMenu size={20} />}
        </div>

        <div className={nav ? 'fixed top-0 right-0 w-full h-full bg-gray-900 flex flex-col items-center justify-center' : 'hidden'}>
          <ul className='text-center space-y-4'>
            <li><Link to="/" className='text-2xl text-amber-400 hover:text-amber-300 transition duration-300' onClick={handleNav}>Home</Link></li>
            <li><Link to="/about" className='text-2xl text-amber-400 hover:text-amber-300 transition duration-300' onClick={handleNav}>About</Link></li>
            <li><Link to="/contact" className='text-2xl text-amber-400 hover:text-amber-300 transition duration-300' onClick={handleNav}>Contact</Link></li>
            <li><Link to="/signup" className='btn' onClick={handleNav}>Sign Up</Link></li>
            <li><Link to="/signin" className='btn btn-outline' onClick={handleNav}>Sign In</Link></li>
          </ul>

          <div className='mt-4'>
            <p className='text-gray-400 text-sm'>© 2024 UrbanRoost. All rights reserved.</p>
            <div className='flex space-x-2 mt-2'>
              <Link to='/privacy' className='text-gray-400 text-sm hover:text-amber-400 transition duration-300'>Privacy</Link>
              <span className='text-gray-400 text-sm'>•</span>
              <Link to='/terms' className='text-gray-400 text-sm hover:text-amber-400 transition duration-300'>Terms</Link>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
